import UIKit
import MapKit

class ViewController: UIViewController {
    
    let locationManager = CLLocationManager()
    var mapView = MKMapView()

    override func viewDidLoad() {
        super.viewDidLoad()
        mapView.delegate = self
        mapView.frame = CGRect(x: 0, y: 0, width: self.view.frame.width, height: self.view.frame.height)
        self.view.addSubview(mapView)
        
        let coordinate = CLLocationCoordinate2D(latitude: 25.1972, longitude: 55.2744)
        let span = MKCoordinateSpan(latitudeDelta: 0.2, longitudeDelta: 0.2)
        let region = MKCoordinateRegion(center: coordinate, span: span)
        mapView.setRegion(region, animated: true)

        let pin = MKPointAnnotation()
        pin.coordinate = CLLocationCoordinate2D(latitude: 40.7886381, longitude: -98.5207638)
        loadPins()
    }
    
    override func viewWillAppear(_ animated: Bool) {
        self.locationManager.requestWhenInUseAuthorization()
        self.locationManager.desiredAccuracy = kCLLocationAccuracyBest
        self.mapView.showsUserLocation = true
        self.locationManager.delegate = self
        self.centreOnUserLoction()
    }
    
    func centreOnUserLoction() {
        if let location = locationManager.location?.coordinate {
            let span = MKCoordinateSpan(latitudeDelta: 0.2, longitudeDelta: 0.2)
            let loc1 = CLLocationCoordinate2D.init(latitude: 52.377956, longitude: 4.897070)
            
            let loc2 = CLLocationCoordinate2D.init(latitude: 48.137154, longitude: 11.576124)
            showRouteOnMap(pickupCoordinate: loc1, destinationCoordinate: loc2)

        }
    }
    
    func loadPins() {
        guard
            let data = defaultPins.data(using: .utf8),
            let chargeModel = try? JSONDecoder().decode(ChargerModel.self, from: data)
        else { return }
        
//        chargeModel.chargelocations.forEach { chargeLocation in
//            let pin = MKPointAnnotation()
//            pin.coordinate = CLLocationCoordinate2D(latitude: chargeLocation.coordinates.lat, longitude: chargeLocation.coordinates.lng)
//            pin.title = chargeLocation.name
//            mapView.addAnnotation(pin)
//        }
    }
    
    func showRouteOnMap(pickupCoordinate: CLLocationCoordinate2D, destinationCoordinate: CLLocationCoordinate2D) {
        let request = MKDirections.Request()
        request.source = MKMapItem(placemark: MKPlacemark(coordinate: pickupCoordinate, addressDictionary: nil))
        request.destination = MKMapItem(placemark: MKPlacemark(coordinate: destinationCoordinate, addressDictionary: nil))
        request.requestsAlternateRoutes = true
        request.transportType = .automobile
        
        let directions = MKDirections(request: request)
        
        directions.calculate { [unowned self] response, error in
            guard let unwrappedResponse = response else { return }

            self.mapView.addOverlay(unwrappedResponse.routes.first!.polyline)
            
            let pointCount = unwrappedResponse.routes.first!.polyline.pointCount

            var firstPoint = unwrappedResponse.routes.first!.polyline.points()[0]
            var distance: CLLocationDistance = 0.0
            var isFirst = true
                for c in 0..<pointCount {
                    let coord = unwrappedResponse.routes.first!.polyline.points()[c]
                    
                    let dist = firstPoint.distance(to: coord)
                    
                    distance += dist
                    firstPoint = coord
                    print("dist: \(distance)")
                    if distance >= 300000 {
                        if isFirst {
                            Networking.shared.getGasStation(coordinate: Coordinate(latitude: coord.coordinate.latitude, longitude: coord.coordinate.longitude), complition: { model in
                                
                                model.chargelocations.forEach { chargeLocation in
                                    let pin = MKPointAnnotation()
                                    pin.coordinate = CLLocationCoordinate2D(latitude: chargeLocation.coordinates.lat, longitude: chargeLocation.coordinates.lng)
                                    pin.title = chargeLocation.name
                                    self.mapView.addAnnotation(pin)
                                }
                            })
                            isFirst = false
                        }
                    }
                    
                    
                    print("step coordinate[\(c)] = \(coord.coordinate.latitude),\(coord.coordinate.longitude)")
                }
            
            self.mapView.setVisibleMapRect(unwrappedResponse.routes.first!.polyline.boundingMapRect, edgePadding: UIEdgeInsets.init(top: 80.0, left: 20.0, bottom: 100.0, right: 20.0), animated: true)
        }
    }
}

